import React, {Component} from 'react';
import classes from "./MyPosts.module.css";
import Post from "./Post/Post"


const MyPosts = () => {

    let postsData = [
        {id: 1, message: 'hi', likesCount: 16},
        {id: 1, message: 'How are you?', likesCount: 27},
        {id: 1, message: 'Fine', likesCount: 56}
    ]

    let postsElements = postsData.map((p) => <Post message= {p.message} likes={p.likesCount}/>)

    return <div className={classes.content}>
        <div className={classes.MyPostsDescription}>
            My posts
            <div className={classes.MyPostsDescription}>
                New post
            </div>

            <div className={classes.MyPostsDescription}>
                {postsElements};
            </div>
        </div>
    </div>
}

export default MyPosts;
